                        String tag = matcher.group(1);
                        if (isUppercase) {
                            builder.setType(StringUtils.upperCase(tag));
                        }
                        else {
                            builder.setType(tag);
                        }
                        report.add(builder.setSeverity(severity).setLineStart(lineNumber).build());
